import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import { useAppSelector } from '../app/hooks'

const Blog = () => {
  const { selectedBlog } = useAppSelector((state) => state.selected)
  const navigate = useNavigate()

  useEffect(() => {
    if(!selectedBlog) {
      navigate('/')
    }
  }, [navigate, selectedBlog])
  console.log(selectedBlog)

  return (
    <div className="h-[70vh] w-full items-center flex justify-center text-[#b6fff4]">
      <p>{selectedBlog?.title}</p>
    </div>
  )
}

export default Blog
